INSERT INTO "TPDPOR"."DIVISION" VALUES ('af11605f31f94ae397547a5710f557a5', ' 网络教育学院 ', '{"text":"广东第二师范学院网络教育学院成立于2016年4月，是在“互联网+教育”背景下成立的负责学校远程教师培训及网络教育的二级学院。网络教育学院下设培训部、资源建设部、技术服务部、教师教育大数据研究中心等部门，主要开展各级各类教师远程培训以及混合培训项目；具体负责学校远程教育网的开发、运维与管理，网络教育资源建设，网络教育平台开发等工作。根据学校安排，学院还负责广东省教育厅部署在学校的教师继续教育信息管理系统、中小学教师信息技术应用能力提升工程公共服务平台等系统的开发、运维与管理工作。另外，广东省中小学教师信息技术应用能力提升工程办公室设在我院，负责全省能力提升工程工作的推动实施、培训测评、信息采集、质量检测等工作。网络教育学院始终坚持以服务和引领网络教育发展为目标，形成了“以需为本、专业引领、融合创新、重在实践”的混合培训模式，依托丰富的培训经验、科学的项目管理、先进的技术支持、雄厚的师资力量、多维的培训课程，构建了具有本校特色的现代网络教育体系，成功组织并开展了教育部—乐高“创新人才培养计划”教师培训、教育部—中国电信中小学校长信息化领导力培训、广东省能力提升工程省级骨干培训以及区域个性化教师培训等项目，取得了良好的社会效益。与时俱进，开拓创新。网络教育学院将全面整合校内外优质教育资源，强化服务理念和品牌意识，不断提升管理水平，不断优化培训学习平台，不断提高培训质量，开启广东第二师范学院远程教育培训新篇章。","content":"<p>广东第二师范学院网络教育学院成立于2016年4月，是在“互联网+教育”背景下成立的负责学校远程教师培训及网络教育的二级学院。</p><p>网络教育学院下设培训部、资源建设部、技术服务部、教师教育大数据研究中心等部门，主要开展各级各类教师远程培训以及混合培训项目；具体负责学校远程教育网的开发、运维与管理，网络教育资源建设，网络教育平台开发等工作。根据学校安排，学院还负责广东省教育厅部署在学校的教师继续教育信息管理系统、中小学教师信息技术应用能力提升工程公共服务平台等系统的开发、运维与管理工作。另外，广东省中小学教师信息技术应用能力提升工程办公室设在我院，负责全省能力提升工程工作的推动实施、培训测评、信息采集、质量检测等工作。<br/></p><p>网络教育学院始终坚持以服务和引领网络教育发展为目标，形成了“以需为本、专业引领、融合创新、重在实践”的混合培训模式，依托丰富的培训经验、科学的项目管理、先进的技术支持、雄厚的师资力量、多维的培训课程，构建了具有本校特色的现代网络教育体系，成功组织并开展了教育部—乐高“创新人才培养计划”教师培训、教育部—中国电信中小学校长信息化领导力培训、广东省能力提升工程省级骨干培训以及区域个性化教师培训等项目，取得了良好的社会效益。<br/></p><p>与时俱进，开拓创新。网络教育学院将全面整合校内外优质教育资源，强化服务理念和品牌意识，不断提升管理水平，不断优化培训学习平台，不断提高培训质量，开启广东第二师范学院远程教育培训新篇章。<br/></p><p><br/></p>"}', '1481177070213', '8e4f5474-053f-11e6-a6db-00ff34dbf6f1', '8e4f5474-053f-11e6-a6db-00ff34dbf6f1', null, 'N', '2016-12/869afb193e8c40cab70630ca9dc715f5.png', '(020)34113157', 'xyb@gdei.edu.cn', '4');
