INSERT INTO "TPDPOR"."RESOURCES" VALUES ('efdea0b06e604446a3dca044c6a2ac0e', '学习改变命运（第3版）', '这是一部关于学习和人生的全国巡回演讲录，每个年轻人都应该读的经典之作。国家新闻出版总署推荐给青少年的100本读物之一。', 'teach', '1482388363902', null, '1482388363902', 'N', '1', '8e4f5474-053f-11e6-a6db-00ff34dbf6f1', null, '2,3,4', null);
