INSERT INTO "TPDPOR"."RESOURCES" VALUES ('9dea4b2673ae47a89b70f714699ef118', '混合式学习：用颠覆式创新推动教育革命', '全面解读在触控屏陪伴下长大的新生代应该如何学习。随书附赠20所美国学校的混合式学习视频案例，扫码即可观看', 'teach', '1482388797217', null, '1482388797217', 'N', '1', '8e4f5474-053f-11e6-a6db-00ff34dbf6f1', null, '2,3,4', null);
INSERT INTO "TPDPOR"."RESOURCES" VALUES ('e0e26dc3933b4a5d925203a31dbf37c3', '教学设计原理（第5版）', '《教学设计原理（第5版）》是教学设计领域的经典著作。本版在秉承前四版的核心思想（即学习分类和教以学为基础）的同时，又体现了鲜明的时代特色。本版修订中的一个突出之处是反映了数字时代的信息技术（主要是计算机和互联网）对教学设计的影响。另一个特色是从系统的角度提出了教学系统设计的若干模型，并重点介绍了ADDIE（分析、设计、开发、实施、评价）模型，从更全面的珀度刻画了教学设计的整个过程。此外，由于近年兴起的建构主义思潮对教学尤其是教学设计有重要影响，因而本版还就和建构主义者的哲学与实践相联系的问题做了分析。最后，在学生行为表现的测量和教学系统的评价部分，本版也适当反映了这些领域的新发展，如真实性测量以及教学系统评价的若干具体类型和方法。由于本次修订有两位新作者加入，因而本版增加了来自军事与培训领域的教学设计的新例子，使得教学设计的理论与技术超出了传统的课堂教学情境而有更广的适用性。', 'teach', '1482388899612', null, '1482388899612', 'N', '1', '8e4f5474-053f-11e6-a6db-00ff34dbf6f1', null, '2,3,4', null);
INSERT INTO "TPDPOR"."RESOURCES" VALUES ('b5b003a1dd01497a9133f092e0e866fb', '教育思想的演进', '《教育思想的演进》根据涂尔干1904-1905年在巴黎大学开设的“法国中等教育史”课程整理而成，是史学界公认的社会史的开山之作。它考察了长达十几个世纪的教育制度和观念史，几乎涵盖了法国启蒙教育从早期教会的“肇发时期”到19世纪的“危机时期”的演进过程。本书不仅把教育观念的演进与思想体系史融通起来，也与教育体制内的制度安排和实践形式环环相扣，以教育为视角和切入点，勾画了一幅现代性在制度化和文明化的意义上从生成到危机的全景。', 'teach', '1482389044088', null, '1482389044088', 'N', '1', '8e4f5474-053f-11e6-a6db-00ff34dbf6f1', null, '2,3,4', null);
INSERT INTO "TPDPOR"."RESOURCES" VALUES ('fb9ba4e09fa248b8a13d8657a44de26b', '教育研究导论', '《教育研究导论》分为四编，共十章组成。内容包括引论、选择和确定教育研究问题、理论界定和研究设计、以个案方式形成研究资料、以测量方式形成研究资料、以干预的方式形成研究资料等。', 'teach', '1482389145823', null, '1482389145823', 'N', '1', '8e4f5474-053f-11e6-a6db-00ff34dbf6f1', null, '2,3,4', null);
INSERT INTO "TPDPOR"."RESOURCES" VALUES ('99499304c0ed4bd39cf05b9283b6072a', '课程的逻辑', '课程改革的过程充满新旧观念的碰撞，引发着多元声音的交响。这是好事。因为，正是这种碰撞和交响，才能给我国基础教育学校的课程与教学带来新的活力和新的希望。
INSERT INTO "TPDPOR"."RESOURCES" VALUES ('c476211536ed43a2b5da00d5cd63a618', '教育的终结：大学何以放弃了对人生意义的追求 [Education''s End:Why Our Colleges and Universities Have Given Up on the Meaning of Life]', '“人为什么而活”——这是人生中最最大的问题。然而，在现代研究理想的影响下，今天的大学从教室里摒除了这一问题。在这本雄辩、流畅而又深思熟虑的著作中，安东尼·克龙曼通过考察人文学科的衰微、学术研究理想的转变、大学的转型等重大主题，探讨了大学放弃追寻人生意义的深层原因。作者主张，大学不仅传播知识，也探讨生命意义的场所。他呼吁复兴大学中失去的人文学科传统，通过精细而批判性地阅读文学和哲学巨著来追寻人生的意义。
