本单元以“我国的世界遗产”为专题，是让学生以自己的方式展示对我国世界遗产的认识，以此让学生领略我国世界遗产风采，激发探究我国世界遗产的兴趣，使学生产生民族自豪感和热爱祖国之情，感受我国世界遗产的魅力。进而引导学生思考如何保护我国世界遗产，唤醒学生保护文物古迹的意识。在合作探究我国世界遗产的过程中，培养学生运用合作、探究的学习方式，锻炼学生搜集资料和筛选、整理资料的能力，并创造性地运用各种形式来展示研究成果。
