-- ----------------------------
-- View structure for BASE_USER_VIEW
-- ----------------------------
CREATE OR REPLACE FORCE VIEW "TPDPOR"."BASE_USER_VIEW" AS 
SELECT   TU.ID AS ID,
            TU.REAL_NAME AS REAL_NAME,
            TU.AVATAR AS AVATAR,
            TU.PAPERWORK_NO AS PAPERWORK_NO,
            TU.STAGE AS STAGE,
            TU.SUBJECT AS SUBJECT,
            TU.PHONE AS PHONE,
            TA.USER_NAME AS USER_NAME,
            TA.PASSWORD AS PASSWORD,
            TA.ROLE_CODE AS ROLE_CODE,
            TA.STATE AS STATE,
            TD.DEPT_NAME AS DEPT_NAME,
            TD.ID AS DEPT_ID,
            TU.ID AS USER_ID,
            TD1.ID AS AREA_ID
     FROM   (   (   (   (   USER_INFO TU
                         JOIN
                            ACCOUNT TA
                         ON ( ( (TU.ID = TA.USER_ID)
                               AND (TA.IS_DELETED = 'N'))))
                     LEFT JOIN
                        USER_DEPT TUD
                     ON ( (TUD.USER_ID = TU.ID)))
                 LEFT JOIN
                   DEPARTMENT TD
                 ON ( ( (TD.ID = TUD.DEPT_ID) AND (TD.IS_DELETED = 'N'))))
             LEFT JOIN
                DEPARTMENT TD1
             ON ( ( (TD1.ID = TD.PARENT_ID) AND (TD1.IS_DELETED = 'N'))))
    WHERE   (TU.IS_DELETED = 'N');

